import Head from 'next/head';
import Navigation from './Navigation';

const Container = (props) => (
  <div>
    <Head>
      <title>{props.title}</title>
    </Head>
    <Navigation/>
    <div className="container p-4">{props.children}</div>
  </div>
);

export default Container;
